import React, { Component } from 'react';
import { relative, isAbsolute } from 'path';
import Typography from 'material-ui/Typography'
import styles from '../../styles'
import Card, { CardActions, CardContent, CardMedia } from 'material-ui/Card';
import ImagePreview from './image-preview';
import Button from 'material-ui/Button';

const cstyles = {
  card: {
    minWidth: 400,
      width: "100%",
      "margin-bottom": 10
  },
  media: {
    height: 200,
  },
};

export default class DocumentsList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      error: '',
        documentOpen:{},
      documents: [
          {
              "$class": "com.rbc.bid.Document",
              "documentId": "doc10",
              "documentType": "CERTIFICATE_OF_INCORPORATION",
              "filename": "certificateOfIncorporation.png",
              "description": "A certificate of incorporation is usually used as an alternative description of a corporation's articles of incorporation. The certificate of incorporation, or articles of incorporation, form a major constituent part of the constitutional documents of the corporation.",
              "mediaType": "image/png",
              "content": "",
              "updatedBy": "RBC Capital Market - Alice Chang",
              "expiryDate": "2030-04-30T18:20:53.288Z"
          }
      ]
    };
    console.log(this.props.store.documentType)
  }
  getDocumentType(type) {
    const s = this.props.store.documentTypes.find((r) => r.id === type);
    return s.label || type;
  }



    handleToggleImage = (documentId) => {
    console.log('handleToggleImage', documentId);
      this.setState({
          ...this.state,
          documentOpen: {
              ...this.state.documentOpen,
              [documentId]: !this.state.documentOpen[documentId]
          }
      })
    }

  render() {
    let {documents} = this.props;
    documents = documents || this.state.documents || [];    
    return (
      <div style={styles.containerWrap}>
        {documents.length > 0 && 
          documents.map((d) => {
          return (
          <Card style={cstyles.card} key={`document-${d.documentId}`}>
          <CardMedia
            image={d.preview}
            title="Contemplative Reptile"
          />
          <CardContent>
            <Typography type="headline" component="h2">
              {this.getDocumentType(d.documentType)}
            </Typography>
            <Typography component="p">
              {d.description}
            </Typography>
            <Typography component="p">
              Updated by: {d.updatedBy}
            </Typography>
            <Typography component="p">
              Expires: {d.expiryDate}
            </Typography>
          </CardContent>
          <CardActions>
            <Button dense color="primary" onClick={() => this.handleToggleImage(d.documentId)}>
                {!this.state.documentOpen[d.documentId] ? 'View' : 'Hide'}
            </Button>
              <Button dense color="primary">
              Audit
            </Button>
          </CardActions>
              {this.state.documentOpen[d.documentId]
                && <ImagePreview imageBase64={d.content}></ImagePreview>
              }
        </Card>
          );
          })
        }
          
    </div>
    );
  }
}